const MyInfo = () => {
    
  const { patientMessages, loading } = usePatientMessages(patientId); 
  const [messages, setMessages] = useState([]);

  return (
    <div className="container mt-4">
      <h1>My Information</h1>
      {loading ? (
        <Spinner splash="Loading Patient Information..." />
      ) : (
        <table className="table">
          <tbody>
            <tr>
              <td>ID:</td>
              <td>{patientInfo.id}</td>
            </tr>
            <tr>
              <td>Name:</td>
              <td>{patientInfo.name}</td>
            </tr>
            <tr>
              <td>Username:</td>
              <td>{patientInfo.username}</td>
            </tr>
            <tr>
              <td>Age:</td>
              <td>{patientInfo.age}</td>
            </tr>
            <tr>
              <td>Diagnosis:</td>
              <td>{patientInfo.diagnosis}</td>
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
};
  
  export default MyInfo;
